import React from "react";
import css from "./FirstPage.module.css";
import axios from "axios";
import { useEffect } from "react";

const titles = () => {
  axios
    .get("https://jsonplaceholder/typicode.com/posts")
    .then((res) => console.log(res));
};

useEffect(() => {
  titles();
});

export const FirstPage = () => {
  return (
    <>
      {titles}
      <div>Titles:</div>;
    </>
  );
};
